import React, { useState } from 'react';

const Crear = () => {
    const [numeroIdentificacion, setNumeroIdentificacion] = useState("");
    const [primerNombre, setPrimerNombre] = useState("");
    const [segundoNombre, setSegundoNombre] = useState("");
    const [primerApellido, setPrimerApellido] = useState("");
    const [segundoApellido, setSegundoApellido] = useState("");
    const [estadoCivil, setEstadoCivil] = useState("");
    const [tipoDocumento, setTipoDocumento] = useState("");
    const [correo, setCorreo] = useState("");
    const [celular, setCelular] = useState("");
    const [genero, setGenero] = useState("");
    const [fechaNacimiento, setFechaNacimiento] = useState("");
    const [fechaExpDocumento, setFechaExpDocumento] = useState("");
    const [fechaIngreso, setFechaIngreso] = useState("");
    const [imagen, setImagen] = useState(null);
    const [message, setMessage] = useState("");

    const handleSubmit = async (e) => {
        e.preventDefault();
        const formData = new FormData();
        formData.append("numero_identificacion", numeroIdentificacion);
        formData.append("primer_nombre", primerNombre);
        formData.append("segundo_nombre", segundoNombre);
        formData.append("primer_apellido", primerApellido);
        formData.append("segundo_apellido", segundoApellido);
        formData.append("estado_civil", estadoCivil);
        formData.append("tipo_documento", tipoDocumento);
        formData.append("correo", correo);
        formData.append("celular", celular);
        formData.append("genero", genero);
        formData.append("fecha_nacimiento", fechaNacimiento);
        formData.append("fecha_exp_documento", fechaExpDocumento);
        formData.append("fecha_ingreso", fechaIngreso);
        formData.append("imagen", imagen);

        try {
            const requestOptions = {
                method: 'POST',
                headers: { 'Content-Type': 'application/json' },
                body: JSON.stringify({ title: 'React POST Request Example' })
            };
            const response = await fetch('http://127.0.0.1:8000/independientes/indeindependienterest/', requestOptions);
            const data = await response.json();
            this.setState({ postId: data.id });
            // let res = await fetch("http://127.0.0.1:8000/independientes/indeindependienterest/", {
            //     method: "POST",
            //     headers: { 'Content-Type': 'application/json' },
            //     body: formData,
            // });
            const resJson = await res.json();
            if (res.status === 200) {
                setNumeroIdentificacion("");
                setPrimerNombre("");
                setSegundoNombre("");
                setPrimerApellido("");
                setSegundoApellido("");
                setEstadoCivil("");
                setTipoDocumento("");
                setCorreo("");
                setCelular("");
                setGenero("");
                setFechaNacimiento("");
                setFechaExpDocumento("");
                setFechaIngreso("");
                setImagen(null);
                setMessage("Usuario creado exitosamente");
            } else {
                setMessage("Ha ocurrido un error");
            }
        } catch (err) {
            console.log(err);
            setMessage("Ha ocurrido un error");
        }
    };

    const handleFileChange = (e) => {
        setImagen(e.target.files[0]);
    };

    return (
        <>
            <h1>Formulario de Registro de Usuarios</h1>
            <form onSubmit={handleSubmit}>
                <input
                    type="text"
                    value={numeroIdentificacion}
                    placeholder="Número de Identificación"
                    onChange={(e) => setNumeroIdentificacion(e.target.value)}
                    required
                />
                <input
                    type="text"
                    value={primerNombre}
                    placeholder="Primer Nombre"
                    onChange={(e) => setPrimerNombre(e.target.value)}
                    required
                />
                <input
                    type="text"
                    value={segundoNombre}
                    placeholder="Segundo Nombre"
                    onChange={(e) => setSegundoNombre(e.target.value)}
                />
                <input
                    type="text"
                    value={primerApellido}
                    placeholder="Primer Apellido"
                    onChange={(e) => setPrimerApellido(e.target.value)}
                    required
                />
                <input
                    type="text"
                    value={segundoApellido}
                    placeholder="Segundo Apellido"
                    onChange={(e) => setSegundoApellido(e.target.value)}
                />
                <select
                    value={estadoCivil}
                    onChange={(e) => setEstadoCivil(e.target.value)}
                    required
                >
                    <option value="">Seleccione Estado Civil</option>
                    <option value="SOLTERO">Soltero/a</option>
                    <option value="CASADO">Casado/a</option>
                    <option value="DIVORCIADO">Divorciado/a</option>
                    <option value="VIUDO">Viudo/a</option>
                </select>
                <select
                    value={tipoDocumento}
                    onChange={(e) => setTipoDocumento(e.target.value)}
                    required
                >
                    <option value="">Seleccione Tipo de Documento</option>
                    <option value="Cc">Cédula de ciudadanía</option>
                    <option value="Ce">Cédula de extranjería</option>
                    <option value="Passport">Pasaporte</option>
                </select>
                <input
                    type="email"
                    value={correo}
                    placeholder="Correo Electrónico"
                    onChange={(e) => setCorreo(e.target.value)}
                    required
                />
                <input
                    type="text"
                    value={celular}
                    placeholder="Número de Celular"
                    onChange={(e) => setCelular(e.target.value)}
                    required
                />
                <select
                    value={genero}
                    onChange={(e) => setGenero(e.target.value)}
                    required
                >
                    <option value="">Seleccione Género</option>
                    <option value="M">Masculino</option>
                    <option value="F">Femenino</option>
                    <option value="O">Otro</option>
                    <option value="P">Prefiero no decir</option>
                </select>
                <input
                    type="text"
                    value={fechaNacimiento}
                    placeholder="Fecha de Nacimiento"
                    onChange={(e) => setFechaNacimiento(e.target.value)}
                    required
                />
                <input
                    type="text"
                    value={fechaExpDocumento}
                    placeholder="Fecha de Expedición del Documento"
                    onChange={(e) => setFechaExpDocumento(e.target.value)}
                    required
                />
                <input
                    type="text"
                    value={fechaIngreso}
                    placeholder="Fecha de Ingreso"
                    onChange={(e) => setFechaIngreso(e.target.value)}
                />
                <input
                    type="file"
                    onChange={handleFileChange}
                />
                <button type="submit">Crear Usuario</button>
                <div className="message">{message ? <p>{message}</p> : null}</div>
            </form>
            <button onClick={() => window.location.href = "/ver"}>Volver a Ver Usuarios</button>
        </>
    );
};

export default Crear;
